import React, { useState, useEffect } from 'react';
import { Navbar, Nav, Container, Button} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../home/master.css'
import './Navbar1.css'
import logo1 from '../images/common/atinity.png';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';


    function Navbar1() {
      const [isFixed, setIsFixed] = useState(false);
    
        useEffect(() => {
        const handleScroll = () => {
          const scrollTop = window.pageYOffset;
          setIsFixed(scrollTop > 0);
        };
    
        window.addEventListener('scroll', handleScroll);
        return () => {
          window.removeEventListener('scroll', handleScroll);
        };
      }, []);
    
    return (
      <div>
      <Router>


        <Navbar expand="lg" className={`navbar ${isFixed ? 'fixed' : ''}`}>
          <Container fluid>
            <Navbar.Brand><img className='navimg' src={logo1} alt="Logo" /></Navbar.Brand>
            <Navbar.Brand href="#"><span>Atinity<br></br> Solution</span></Navbar.Brand>
            <Navbar.Toggle aria-controls="navbarScroll" />
            <Navbar.Collapse id="navbarScroll">
              <Container className=" d-flex justify-content-end">
                <Nav>
                  <Nav.Link href="#deets">Home</Nav.Link>
                  <Nav.Link href="#deets">About Us</Nav.Link>
                  <Nav.Link href="#deets">Services</Nav.Link>
                  <Nav.Link href="#deets">Projects</Nav.Link>

                </Nav>
              </Container>
              <Nav.Link as={Link} to="../main/Contact"><Button className='navbtn rounded-pill ' variant="outline-success"  onClick={<Link to="../form/Login"/>} >GET IN TOUCH</Button></Nav.Link>

              

            </Navbar.Collapse>
          </Container>
        </Navbar>
        </Router>


      </div>
    )
  }


export default Navbar1;
